INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(1, 'Responsabilidad', 'Habilidad de lograr con calidad las tareas asignadas, en el lugar y el momento adecuados, con el objetivo de responder a nuestros compromisos y respetando las normas acordadas. \no	Trabaja de forma constante.\no	Se mantiene conectado/a a la actividad del grupo. \no	Hace comentarios relacionados con la tarea a realizar.\no	Realiza las tareas de forma eficiente.\no	Realiza las tareas con cuidado.\no	Persevera ante las dificultades. \no	Respeta las normas.', );
INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(2, 'Cooperación', 'Habilidad de interaccionar de forma constructiva y a partir de la escucha, con el objetivo de conseguir una meta común y consensuada. o	Escucha a los demás. o	Incorpora lo que dicen los demás. o	Fomenta la participación de los miembros del grupo. o	Participa en la toma de decisiones consensuadas. o	Ayuda a resolver conflictos. o	Reconoce sus responsabilidades y las de los demás. o	Ayuda a los demás de forma desinteresada.', );
INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(3, 'Autonomía e iniciativa', 'Habilidad de emprender acciones e implicarse en las actividades, utilizando los recursos propios, y de saber cuándo pedir ayuda. o	Aporta ideas. o	Hace preguntas cuando se encalla. o	Toma decisiones para que el proyecto avance. o	Sabe convencer al grupo de sus propuestas. o	Trabaja con determinación. o	Cree que puede iniciar cambios.', );
INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(4, 'Gestión emocional', 'Habilidad de percibir y aceptar las emociones propias y las de los demás, con el objetivo de desarrollar estrategias de gestión personal eficaces. o	Transmite alegría. o	Se muestra tranquilo/a en situaciones de presión. o	Controla las emociones en situaciones de conflicto. o	Asume la posibilidad de equivocarse. o	Acepta que los cambios que propone no salgan adelante. o	Adecúa el comportamiento a las circunstancias.', );
INSERT INTO `pentabilities` (`Id`, `Name`, `Explanation`, `Image`) VALUES
(5, 'Habilidades de pensamiento', 'Habilidad de relacionar, cuestionar, generar y exponer ideas. o	Relaciona contenidos nuevos con conocimientos previos. o	Hace buenas reflexiones sobre los contenidos trabajados. o	Hace buenas reflexiones sobre sus procesos personales internos. o	Hace buenas preguntas (para entender o para permitir avanzar). o	Tiene ideas creativas (explora caminos alternativos). o	Plantea buenas estrategias de resolución de problemas. o	Tiene interés en explorar perspectivas diferentes. o	Expresa eficazmente las ideas (corrección, precisión y estructura).', );

